(1389, 'CSE463', 'Computational Geometry', 4, 2, 'Jul_2016', 2016, 'A+', 'Radi Muhammad Reza', '204', 3, 0, 0, 0, 0, 0, 0, 0, 0, 0, 'Is Radi sir the only teacher for computational geometry !! I think he is busy with his own study plan. He paid no attention in his duties . Specification of offline was uploaded in moodle the day before submission. Offline was declared in theory class not in lab ! Even sometime i dont know that there is a offline next week as i missed the class or went late in the class. This course was a show of how to neglect one''s duty.Boring class.No preparation for the class. No answer of student''s question.\r\n"Jara bujar tara emnitei buje geso " \r\n"Eta na bujar ki ase.pore nije buje nio."\r\n:) :) :) '),
