(1418, 'CSE107', 'Object Oriented Programming Language', 1, 2, 'Jul_2016', 2016, 'A+', 'Dr. Mohammad Mahfuzul Islam, Mohammad Saifur Rahman', '104', 8, 3, 2, 3, 4, 3, 4, 4, 4, 4, 'Having C++ and Java in the same term might have minimized the time slot that is needed to learn the language properly and thoroughly. Often it was hard to cope with the pace of the course as there are too many things to do in short periods.'),
