(1438, 'CSE107', 'Object Oriented Programming Language', 1, 2, 'Jul_2016', 2016, 'B', 'Dr. Mohammad Mahfuzul Islam, Mohammad Saifur Rahman', '103', 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, ''),
(1439, 'CSE108', 'Object Oriented Programming Language Sessional', 1, 2, 'Jul_2016', 2016, 'B', 'Md. Aashikur Rahman Azim, Ishtiyaque Ahmad, Madhusudan Basak, Dr. Mahmuda Naznin, Mohammad Saifur Rahman, Ch. Md. Rakin Haider, Sabbir Ahmad, Shareef Ahmed, Md. Shariful Islam Bhuyan, Siddhartha Shankar Das, Tanmoy Sen', '404', 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, ''),
(1440, 'CSE103', 'Discrete Mathematics', 1, 2, 'Jul_2016', 2016, 'A+', 'Dr. M. Kaykobad, Sukarna Barua', '107', 1, 4, 3, 4, 4, 3, 4, 4, 4, 4, 'As the HSC 16 students have learned a lot about C language in ICT, I think CSE 103 should be included in 1-1 syllabus along with CSE 101, in exchange with bringing a non departmental course to 1-2, say PHY 109 or ME 165, so that students can put all their efforts on CSE 107 and CSE 108 in 1-2, as the syllabii of these courses is amazingly large to cope up with..'),
(1441, 'CSE107', 'Object Oriented Programming Language', 1, 2, 'Jul_2016', 2016, 'A', 'Dr. Mohammad Mahfuzul Islam, Mohammad Saifur Rahman', '103', 5, 4, 3, 4, 4, 4, 4, 4, 4, 4, 'If possible, this course should be divided. At least some of the parts of C++, which are very close to C, should be covered with C in 1-1 so that students get more time for Java as it is almost impossible to cover this language in 7-8 weeks.'),
(1442, 'CSE108', 'Object Oriented Programming Language Sessional', 1, 2, 'Jul_2016', 2016, 'A+', 'Md. Aashikur Rahman Azim, Ishtiyaque Ahmad, Madhusudan Basak, Dr. Mahmuda Naznin, Mohammad Saifur Rahman, Ch. Md. Rakin Haider, Sabbir Ahmad, Shareef Ahmed, Md. Shariful Islam Bhuyan, Siddhartha Shankar Das, Tanmoy Sen', '406', 3, 4, 2, 4, 1, 2, 2, 3, 3, 4, 'We are barely taught JavaFX, though we have to prepare a term project which sometimes require a vast amount of knowledge of JavaFX . My project did not require too much UI component so I somehow managed to pull through this situation. But some of my friends had to really put a lot of time and effort only because of lacking of some fundamental knowledge on JavaFX which could easily be reduced by only one or two extra classes on JavaFX . And all of our project advisors were really helpful, otherwise students could not complete the projects just because of JavaFX. This situation should be improved.'),
