(1976, 'CSE108', 'Object Oriented Programming Language Sessional', 1, 2, 'Jul_2016', 2016, 'A+', 'Md. Aashikur Rahman Azim, Ishtiyaque Ahmad, Madhusudan Basak, Dr. Mahmuda Naznin, Mohammad Saifur Rahman, Ch. Md. Rakin Haider, Sabbir Ahmad, Shareef Ahmed, Md. Shariful Islam Bhuyan, Siddhartha Shankar Das, Tanmoy Sen', '103', 20, 3, 3, 3, 3, 2, 1, 3, 3, 3, ''),
(1977, 'CSE401', 'Artificial Intelligence', 4, 1, 'Jul_2016', 2016, 'A', 'Dr. Md. Monirul Islam, Abu Wasif', '206', 3, 2, 1, 0, 1, 2, 3, 2, 2, 2, 'The course should be modernised with more emphasis on the topics that are relevant now. For seven weeks we were taught a topic that seemed to have have no practical application.'),
(1978, 'CSE403', 'Digital System Design', 4, 1, 'Jul_2016', 2016, 'A', 'Md. Aashikur Rahman Azim, Md. Iftekharul Islam Sakib', '206', 3, 0, 1, 0, 0, 0, 0, 1, 0, 0, 'The course teaches an ancient book (Hall) and the topics covered does not give a student a good idea of how to design good digital systems. The course should focus on general design principles. Also I expected this course to elaborate on what is contained in the PC, laptop etc. that we use everyday. It is astonishing that we have spent three and half year studying computer science and engineering and still no course ever taught what is in a motherboard. The digital systems that we use everyday should be given much more importance compared to how to interface with obsolete ICs. '),
(1979, 'CSE404', 'Digital System Design Sessional', 4, 1, 'Jul_2016', 2016, 'A', 'Md. Aashikur Rahman Azim, Ishtiyaque Ahmad, Md. Abdus Sattar, Mohammad Saifur Rahman, Md. Tarikul Islam Papon, Md. Iftekharul Islam Sakib, Md. Shariful Islam Bhuyan, Dr. Md. Yusuf Sarwar Uddin', '206', 8, 1, 1, 0, 1, 1, 1, 0, 1, 1, 'I thought in this course I was supposed to learn how to design a digital system. Instead I had to hours after hours with a simulation software. I thought a significant part of this course should have been about how to interface with digital devices. Instead I spent good amount of time behind "keeping a robotic car going in straight line".  '),
