(1818, 'CSE402', 'Artificial Intelligence Sessional', 4, 1, 'Jan_2016', 2016, 'A', 'azadsalam', '401', 25, 2, 2, 1, 0, 0, 2, 2, 2, 2, 2, 2, 2, 3, 0, 0, 'The authority of a final year course should be handed over to senior teachers. It is a must, in my opinion. Course should be designed by an experienced teacher, because that is a quality not even any genius can achieve in early days; experience. A lot of things come with it, including common senses.\r\n\r\nOne more thing I cannot help pointing out is, in this fast civilized era, most people are suffering from psychological incompleteness more than any other thing. At this time of competitive lifestyle of showing off in social networking, it is hard for immature people to stay sane about a lot of things. Despite being in the middle of this crisis, we need new teachers, but at least they should be given the opportunity and time so that they can grow.\r\n\r\nThe department had to take too many teachers from the same batch to cover a gap; that does not necessarily demands to be called a crisis, but with this teacher in the department, the crisis cries out.\r\n\r\nThere is another thing I want to add, I have no place to say this, but I am kind of misusing the power of being anonymous here; by saying having the ever-growing love for the department, that a student should go through more than excelling the exams to be a teacher of the best university of the country. There should be exhaustive psychological tests, along with medical tests- I am not joking, and also history-checking to understand the kind of person one is. This need has been insignificant in past days, but now, I do not think it is anymore. \r\n\r\nI am not mentioning any small details to explain the cause of this long comment, but they are truly overwhelming.'),
