(4332, 'CSE103', 'Discrete Mathematics', 1, 2, 'Jul_2016', 2016, 'A+', 'kaykobad', '103', 1, 3, 2, 1, 1, 0, 1, 0, 0, 2, 2, 3, 0, 0, 3, 1, 'To be frank, I think so far we don''t qualify to be student of Dr. Kaykobad. His knowledge and proficiency is known all over the world. Many of level 1 students have still not reached that kind of quality to be enlightened by him. Also, sir goes through the topics so quickly that only few of the students can cope up him, and most of these students have good academic background. They participated in math, physics, informatics olympiads in school college level, and knows Kaykobad sir for a long time. So, for the general students, it has been a '' not so good '' experience.'),
(4333, 'CSE107', 'Object Oriented Programming Language', 1, 2, 'Jul_2016', 2016, 'A+', 'mrahman', '103', 2, 3, 2, 2, 4, 3, 4, 2, 2, 2, 2, 2, 4, 4, 4, 2, ''),
