(4335, 'CSE108', 'Object Oriented Programming Language Sessional', 1, 2, 'Jul_2016', 2016, 'D', 'siddhartha', '404', 2, 2, 3, 2, 3, 3, 3, 2, 3, 3, 1, 1, 4, 4, 4, 2, ''),
