(4380, 'CSE403', 'Digital System Design', 4, 1, 'Jul_2016', 2016, 'A+', 'aashik', '205', 2, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 'Ashik sir has a beautiful smile and this smile clings on to his face no matter what the situation is. I like this very much about him. But often he talks too fast to follow. :/\r\n'),
(4381, 'CSE103', 'Discrete Mathematics', 1, 2, 'Jul_2016', 2016, 'A+', 'kaykobad', '103', 0, 4, 2, 4, 3, 1, 3, 3, 2, 4, 4, 4, 3, 4, 4, 2, 'I believe a quite a large fraction of the class was having trouble keeping up with him. But his lectures were extremely insightful. I personally loved the puzzles he shared with us in class.'),
