(5384, 'CSE214', 'Assembly Language Programming', 2, 2, 'Jul_2016', 2016, 'A', 'papon', '408', 2, 3, 3, 2, 4, 3, 2, 3, 3, 2, 3, 2, 4, 4, 3, 3, ''),
(5385, 'CSE409', 'Computer Graphics', 4, 2, 'Jul_2016', 2016, 'A+', 'ishtiyaque', '204', 4, 2, 0, 1, 0, 0, 2, 4, 2, 2, 1, 0, 2, 0, 4, 0, 'Sir told us that he will not take any attendance throughout the term. That made the students reluctant to attend the classes. Also, when there are only a few students, I think it demotivated sir as well.\r\n\r\nHe was very slow in uploading the class test marks.\r\n\r\nHis approach should be a lot easier to students. During class, often I got the feeling that he was an outsider.\r\n\r\nHis voice was quite loud, thumbs up there.\r\n\r\nHe almost always was prepared for the class, but sometimes stumbled. He should be more careful with these to deliver a dominating lecture.\r\n\r\nI wish him all the best.'),
(5386, 'CSE409', 'Computer Graphics', 4, 2, 'Jul_2016', 2016, 'A+', 'ierabban', '204', 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 'All the best to dear Ishat sir.'),
(5387, 'CSE409', 'Computer Graphics', 4, 2, 'Jul_2016', 2016, 'A', 'ishtiyaque', '205', 5, 4, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 4, 4, 3, 3, ''),
(5388, 'CSE409', 'Computer Graphics', 4, 2, 'Jul_2016', 2016, 'A', 'ierabban', '205', 5, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, ''),
(5389, 'CSE471', 'Machine Learning', 4, 2, 'Jul_2016', 2016, 'A+', 'madhusudan', '204', 5, 2, 2, 2, 4, 3, 4, 4, 3, 2, 1, 0, 4, 1, 1, 3, 'Sir always seems a little too easy for the students. Often this is a thumbs up, but there should a little separation between teachers and students. The students should not be so comfortable to consider a teacher a friend like a batch-mate.\r\n\r\nSir was very prompt in uploading the class test marks, that is a clear thumbs up.\r\n\r\nHe was also quite responsive to students'' needs. That''s another plus one.\r\n\r\nHe has some serious issues understanding the students'' questions. Often what he speaks are quite understandable and easily captured by students, but when its the other way round, like a student asks something in the class, sir does not seem to get the question and repeats himself over and over again, sometimes saying something completely off the topic of the question asked. He does not even get that he was saying things off the topic because the students do not seem to linger on one single question.\r\n\r\nClass tests did not cover a fat portion of the syllabus. It is expected that the students will have to struggle during the term final for this.\r\n\r\nAlso, evaluation of a class test seemed a little biased. All the students who were participating in the cultural programs scored a 20. May be this is a misreading of the writer of these comments but it was quite a gaudy scene.\r\n\r\nI wish him all the best in his teaching career.'),
